import React from 'react'

export default class Square extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            value: null
        }
    }

    handleClick() {
        this.setState({value: 'X'})
    }

    render() {
        return (
            <button className="square" onClick={this.handleClick()} >
                {this.state.value}
            </button>
        )
    }
}
